import React from "react";
import { observer } from "mobx-react-lite";
import logo from "../header/logo.png";

function MainPage() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <h1>Полина Мальцева</h1>
      </div>
        <img alt="Фото профиля polina_education"
             src="https://scontent-frx5-2.cdninstagram.com/v/t51.2885-19/161580764_298023891666249_7945125167423087095_n.jpg?stp=dst-jpg_s150x150&amp;_nc_ht=scontent-frx5-2.cdninstagram.com&amp;_nc_cat=109&amp;_nc_ohc=XoVJ4-dl1GAAX_oGsBH&amp;edm=ALbqBD0BAAAA&amp;ccb=7-5&amp;oh=00_AT9X-c9HxSGg7iuRsxGof-UuwVZnodaNHIJZyFJtnLLh5Q&amp;oe=62C0C2FC&amp;_nc_sid=9a90d6"/>
        {/*<img src={logo} alt="logo" height="50px" width="50px"/>*/}
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <h3>Ведущий эксперт в теме школьного образования</h3>
      </div>
        <div style={{
            display: "flex",
            justifyContent: "center",
            whiteSpace: "pre-line"
        }}>
            {
                "Помогаю родителям и школам выстраивать траекторию обучения и развития детей" +
                "\n\n— Руководила проектом создания школы «Летово»" +
                "\n— Возглавляю социальную инфраструктуру г. Доброград, в котором в 2021 была открыта школа «Мир»" +
                "\n— Работала в Департаменте образования г. Сан-Франциско" +
                "\n— Имею 4 высших образования, в том числе Harvard Business School (MBA)"
            }
        </div>
    </div>
  );
}

export default observer(MainPage);
